import React, { Component } from "react";
import avatar from "./avatar.jpg";

class PVModePersonalDetails extends Component {
  render() {
    return (
      <div className="flex flex-col space-y-4 bg-slate-400 w-1/4">
        <div className="m-3">
          <img src={avatar} />
        </div>

        <div className="flex flex-col space-y-2">
          <h1 className="pvHeader"> Personal Details</h1>
          <ul className="flex flex-col space-y-2">
            <li className="list-none"> Address </li>
            <li className="list-none"> Phone Number </li>
            <li className="list-none"> Email </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default PVModePersonalDetails;
